import React from 'react';

import './App.css';
import Menu from './components/header/header.js';
import Header from './components/menu/menu.js';

class App extends React.Component {
  render() {
    return (
     <div className="topmenu"> 
      <Menu/>
      <Header/>
     </div>
    );
  }
}


export default App;
